    "2013-03-14T21:42:58.879298",nt"name": "bathymetric-map-of-the-bering-chukchi-sea",nt"isopen":
    false,nt"url": null,nt"notes": "Two bathymetric maps were developed by
    the U.S. Geological Survey, one for the Chukchi Sea and Arctic Ocean, and one for
    the Aleutian Trench and Bering Sea. The 2 maps overlap near the Bering Strait. Bathymetric
    contours were generated from several published sources. It is unclear whether new
    soundings were collected for these maps. The northern map extends from Wrangel Island,
    Russia to MacKenzie Bay, Canada, and north to 76 N latitude. The southern map extends
    from Shelikof Bay, Russia, to the western tip of the Alaska Peninsula, USA, and
    south to 48 N latitude. Bathymetric contours are at 400 meter intervals with 20,
    30, 40, 50, 100, and 200 meter contours added. Contours above 50 meters are rare,
    and never along the Russian coast. Hard-copy maps were published by the USGS in
    1976 and digitized by the Alaska Science Center in 1997. In digital format, the
    2 maps have been connected where they overlap in the Bering Strait.",nt"license_title":
